import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Axios from 'axios';


function Form() {
    const[email,setEmail]=useState("");
    const[name,setName]=useState("");
    const[password,setPassword]=useState("");

    const submit=(event)=>{
        event.preventDefault();
        const datatosubmit = {
            email,
            name,
            password,

        }
    }
        fetch('http://13.233.173.87:8000/api/user/register/',{
        method:'POST',
        headers:{
            'content-type':'application/json; charset=UTF-8',
        },
        body: JSON.stringify(datatosubmit)
    }).then(res => res.json())
        .then(res =>{
            console.log(res)
        })

  return (
    <div>
        <>
            <form className='form' method='post' action='#' onSubmit={submit}>
                <div>
                    <label htmlFor='email'>Email</label>
                <input type="text" name="email"  value={email} onChange={(e)=>{setEmail(e.target.value)}} id="email"></input>
                </div>

                <div>
                    <label htmlFor='Name'>Name</label>
                <input type="text" name="name" value={name} onChange={(e)=>{setName(e.target.value)}}id="name"></input>
                </div>

                <div>
                    <label htmlFor='password'>password</label>
                <input type="text" name="email" value={password}onChange={(e)=>{setPassword(e.target.value)}} id="pass"></input>
                </div>

                <div>
                    <label htmlFor='passwprd'> confirm password</label>
                <input type="password" name="passw" value={password} onChange={(e)=>{setPassword(e.target.value)}} id="passw"></input>
                </div>



                <button  
                type="submit" id='send' >

                Register</button>

                <div>
                <Link className="login" to="/login">
                  Go to  Login
                </Link>

                </div>

            </form>

        </>
    </div>
  )
}

export default Form
